import ExpenseItem from './components/ExpenseItem';
function App() {
  const expenses = [
    {title:'Car insurance',amount:'23,000',date:new Date (23,8,2021)},
    {title:'Rent',amount:'20,000',date:new Date (2,4,2021)},
    {title:'Internet',amount:'3,000',date:new Date (3,6,2021)},
    {title:'Transport',amount:'4,000',date:new Date (13,7,2021)},
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].amount} date={expenses[0].date}/>
      <ExpenseItem/>
      <ExpenseItem/>
      <ExpenseItem/>

    </div>
  );
}

export default App;
